import './App.css';
import NavBar from './Components/1-NavBar/NavBar';
import WGIF from './Components/2-WGIF/WGIF';
import Middel from './Components/3-Middel/Middel';
import Product from './Components/4-Category/Category';
import Newsletter from './Components/5-Newsletter/Newsletter';


function App() {
  return (
    <div className="App">
      <NavBar/>
      <WGIF/>
      <Middel/>
      <Product/>
      <Newsletter/>
      <WhyIbrim/>
    </div>
  );
}

export default App;
